    reported on Schedule D Debts and Obligations) filed with the 30 Day Post General
    report had been incorrectly left unchecked.  The FECfile software would not allow
    either modification or deletion and reposting of these disbursements so the MEMO
    box could be checked and an amended Post General report could be filed.  This
    will be corrected as soon as can be done.    The Cash on Hand at close of period
    (Summary Page, line 8) should be $142,957.30 when corrected, which will also be
    the opening Cash on Hand for the Year End report once amended reports can be filed..\n"
